function (inputs, outputs, context) {
    const { value } = inputs;
    const { output1, output2, output3 } = outputs;
    const { state } = context;

    const index = state.get("index") || 0;

    if (index === 0) {
      output1.next(value);
      state.set("index", 1);
    } else if (index === 1) {
      output2.next(value);
      state.set("index", 2);
    } else {
      output3.next(value);
      state.set("index", 0);
    }
  }
